#60. Permutation Sequence
class Solution:
    def getPermutation(self, n: int, k: int) -> str:
        import itertools
        lst=[i for i in range(1, n+1)]
        a=[]
        for i in itertools.permutations(lst):
            res=''
            for j in i:
                res+=str(j)
            a.append(int(res))
        a.sort()
        return str(a[k-1])
x=1534236469
x_revers=int(str(abs(x))[::-1])
if x>=0 and x_revers<2**31:
    print(x_revers)
elif x<0 and x_revers<2**31:
    print(-1 * x_revers)
else:
    print(0)